import styled from "styled-components";

const AuctionStyle = styled("div")`

  form{
      margin: 0 auto;
      width: 80vw;
      align-items: center;
  .theForm {
    margin: 0 auto;
    width: 50%;
    margin-bottom: 30px;
    @media(max-width: 700px) {
        width: 80%;
        margin-top: 20px;
    }
    .title,
    .description,
    .ImageLink,
    .genderList {
      margin-bottom: 20px;
      width: 80%;
      text-align: left;
    }
  }
  .title {
      input{
          width: 100%;
      }
  }
  .description {
      textarea {
          width: 100%;
          height: 100px;
      }
  }
  .ImageLink {
      input {
          width: 100%;
      }
  }
  .genderList {
    list-style: none;
  }
}
.startingPrice {

        width: 100%;

}
`;

export default AuctionStyle;
